export function jsx<Element, Attribute>(e: () => Element, a: () => Attribute) {
	return({
		xmlns: 'http://www.opengis.net/wfs',

		WFS_Capabilities: e(),

		FeatureTypeList: e(),
		FeatureType: e(),

		Name: e(),
		Title: e(),

		GetFeature: e(),

		Query: e(),
		Filter: e(),
		BBOX: e(),
		Intersects: e(),
		Envelope: e(),
		lowerCorner: e(),
		upperCorner: e(),

		FeatureCollection: e(),

		numberOfFeatures: a()
	});
}
